import React from 'react';
import logo from './logo.svg';
import './App.css';
import { BrowserRouter } from 'react-router-dom';
import Routes from "./routes.js";
import Navbar from './Navbar.js';

function checkLogged() {
    var response2 = false;
    fetch('/login', {
        method: 'GET',
    }).then(response => {
        if (response.ok) {
            response2 = true;
        } else {
            response2 = false;
        }
    })
    return response2;
}

function App() {
  return (
    <div className="App">
      <BrowserRouter>
          
        <Routes isLoggedIn = {checkLogged()}/>
      </BrowserRouter>
    </div>
  );
}

export default App;
